import React from "react";

function Homepage() {
  return (
    <div className="flex justify-center">
      <div className="flex justify-evenly items-centerh-48 w-96 bg-blue-600">
        <div className="bg-green-600 w-32 h-32 rounded"></div>
        <div className="bg-red-600 w-32 h-32 rounded"></div>
      </div>
    </div>
  );
}

export default Homepage;
